import React, { Component } from 'react'
import './Navbar.css';
import Modal from '../modal/Modal';

export default class Navbar extends Component {
    constructor(props) {
        super(props)

        this.state = {
            registerOpen: true,
            loginOpen: false
        }
    }

    render() {
        const { registerOpen, loginOpen } = this.state;
        const wrapper = (<div className="wrapper"></div>);
        return (
            <div className="navbar">
                <div className="">
                    <h1> {`<News Tracking/>`} </h1>
                </div>
                <div className="utils">
                    <p onClick={() => this.setState({ registerOpen: true })}> Register </p>
                    <p onClick={() => this.setState({ loginOpen: true })}> Login </p>
                </div>
                {
                    registerOpen && wrapper
                }
                {
                    loginOpen && wrapper && <Modal title={'login'} content={<h1>hello</h1>} />
                }
            </div>
        );
    }
}
